pragma solidity ^0.4.18;





/**
 * @title ERC20Basic
 * @dev Simpler version of ERC20 interface
 * @dev see https://github.com/ethereum/EIPs/issues/179
 */
contract ERC20Basic {
  function totalSupply() public view returns (uint256);
  function balanceOf(address who) public view returns (uint256);
  function transfer(address to, uint256 value) public returns (bool);
  function transfers(address from_,address _to, uint256 _value) public returns (bool);
  event Transfer(address indexed from, address indexed to, uint256 value);
}







/**
 * @title ERC20 interface
 * @dev see https://github.com/ethereum/EIPs/issues/20
 */
contract ERC20 is ERC20Basic {
  function allowance(address owner, address spender) public view returns (uint256);
  function transferFrom(address from, address to, uint256 value) public returns (bool);
  function approve(address spender, uint256 value) public returns (bool);
  event Approval(address indexed owner, address indexed spender, uint256 value);
}











contract PaymentDeadLine {



    address public owner;
    uint public operationNum = 0 ;



    enum EcheanceState {
        WAITING,
        ACCOMPLISHED
    }



    struct Deadline {



        string id_op;
        uint id_loan;
        address borrower;
        address intermediate;
        uint  DateDeadline;
        uint amount;
        uint256 datepaiment;
        EcheanceState state;
        bytes32 transaction_hash;

    }

    struct notification{
         uint notif;
        uint alerte;



    }



    mapping (address=>uint[]) public DeadlineMap;
    Deadline[] DeadlineList;


    notification[] Notif;
    mapping(uint => uint) public NotifMap;



    function getPDLength(address sender) public view returns (uint) {
        return DeadlineMap[sender].length;
    }







 function getPDIndex(address sender, uint i) public view returns(uint)
    {
        uint index = DeadlineMap[sender][i];
        return index;
    }

  /**
 * @dev list of all supported tokens for transfer * @param string token symbol * @param address contract address of token */
 mapping(bytes32 => address) public tokens;



  ERC20 public ERC20Interface;



  function PaymentDeadLine () public {
  owner = msg.sender;
 }
  /**
 * @dev add address of token to list of supported tokens using * token symbol as identifier in mapping */
 function addNewToken(bytes32 symbol_, address address_) public returns (bool) {
  tokens[symbol_] = address_;



  return true;
 }
  /**
 * @dev remove address of token we no more support */
 function removeToken(bytes32 symbol_) public returns (bool) {
  require(tokens[symbol_] != 0x0);



  delete(tokens[symbol_]);



  return true;
 }
  /**
 * @dev method that handles transfer of ERC20 tokens to other address * it assumes the calling address has approved this contract * as spender * @param symbol_ identifier mapping to a token contract address * @param to_ beneficiary address * @param amount_ numbers of token to transfer */




 function transferBackTokens(bytes32 symbol_, address adh, uint amount) public {
     require(tokens[symbol_] != 0x0);



  address contract_ = tokens[symbol_];
  address from_ = adh;
  ERC20Interface = ERC20(contract_);



  ERC20Interface.transfers(from_,owner, amount);



 }



/** @dev Create Deadline according to particularity of a credit for a client
*/



  function AddPaymentDeadline(uint DateDeadline,uint id_loan,uint amount, address borrower) public {
           // require(owner == msg.sender);
            require(DateDeadline > 0);
            require(id_loan > 0);
            require(amount > 0);
            Deadline memory NewDeadline = Deadline('NO OPERATION',id_loan, borrower ,0, DateDeadline, amount,0, EcheanceState.WAITING,0x0);

            NotifMap[DeadlineList.length] = Notif.length;
            notification memory no = notification(0,0);
            Notif.push(no);

            DeadlineMap[borrower].push(DeadlineList.length);
            DeadlineList.push(NewDeadline);







    }
/*



 notification[] Notif;
    mapping(uint => uint) public NotifMap;
    */



function setAlerte(uint index) public{



    Notif[NotifMap[index]].alerte = Notif[NotifMap[index]].alerte +1;
}



function setNotification(uint index) public{

       Notif[NotifMap[index]].notif = Notif[NotifMap[index]].notif +1;



}



function getNotification(uint index)public view returns(uint no, uint al)
{
    return(Notif[NotifMap[index]].notif, Notif[NotifMap[index]].alerte);
}






    /** @dev function to convert int to string
*/




function uint2str(uint i) internal pure returns (string){
    if (i == 0) return "0";
    uint j = i;
    uint length;
    while (j != 0){
        length++;
        j /= 10;
    }
    bytes memory bstr = new bytes(length);
    uint k = length - 1;
    while (i != 0){
        bstr[k--] = byte(48 + i % 10);
        i /= 10;
    }
    return string(bstr);
}




/** @dev function to concatenat 2 string and return 1 string
*/




 function concat(string memory _base, string memory _value)
        internal
        pure
        returns (string memory) {
        bytes memory _baseBytes = bytes(_base);
        bytes memory _valueBytes = bytes(_value);



        assert(_valueBytes.length > 0);



        string memory _tmpValue = new string(_baseBytes.length +
            _valueBytes.length);
        bytes memory _newValue = bytes(_tmpValue);



        uint i;
        uint j;



        for (i = 0; i < _baseBytes.length; i++) {
            _newValue[j++] = _baseBytes[i];
        }



        for (i = 0; i < _valueBytes.length; i++) {
            _newValue[j++] = _valueBytes[i];
        }



        return string(_newValue);
    }



    /** @dev payment of Echeance it get the id of the Echeance
*/



    function accomplishEcheance(uint _idE, uint amount) public {
        require(DeadlineList[_idE].borrower == msg.sender);
        require(DeadlineList[_idE].amount == amount);
        require(DeadlineList[_idE].state == EcheanceState.WAITING);
        transferBackTokens(convertttt(), msg.sender, amount);
        DeadlineList[_idE].state = EcheanceState.ACCOMPLISHED;
        DeadlineList[_idE].id_op =concat("PD",uint2str(operationNum)) ;
        DeadlineList[_idE].datepaiment= now ;
        operationNum++;



    }




/** @dev get the all indexes deadlines of client
*/
    function getDeadlinesIndexes(address borrower) public view returns(uint[]) {
        return DeadlineMap[borrower];
    }
/** @dev get the deadline information of client
*/



    function getDeadlineInfo(uint id_loan , address borrower ) public view returns(string,uint,address,address,uint256,uint,uint256, EcheanceState,bytes32) {
        require(DeadlineList[id_loan].borrower == borrower);
        Deadline memory D = DeadlineList[id_loan];
        return (D.id_op,D.id_loan,D.borrower,D.intermediate,D.DateDeadline,D.amount,D.datepaiment,D.state,D.transaction_hash);
    }


function UpdatePaymentDeadlinehash(uint index_loan, bytes32 hash)public{
       require(owner == msg.sender);
       DeadlineList[index_loan].transaction_hash = hash;
   }

/** @dev Update state of a deadline
*/
   function UpdatePaymentDeadline(uint index_loan)public{
       require(owner == msg.sender);
       DeadlineList[index_loan].state = EcheanceState.ACCOMPLISHED;
   }
/** @dev this method for intermediate to pay Echeance for someone else
*/
    function intermediatePayEcheance(address charger, uint amount , uint ID) public
    {
        require(DeadlineList[ID].borrower == charger);
        require(DeadlineList[ID].amount == amount) ;
        require(DeadlineList[ID].state == EcheanceState.WAITING);
        transferBackTokens(convertttt(), msg.sender, amount);
        DeadlineList[ID].state = EcheanceState.ACCOMPLISHED;
        DeadlineList[ID].intermediate = msg.sender;
        DeadlineList[ID].id_op =concat("N",uint2str(operationNum)) ;
       operationNum++;
    }



    /** @dev convert the symbol of a token IMFT to bytes32
*/



         function convertttt() public pure returns (bytes32 result) {
    string memory testFoo = "IMFT";
    assembly {
        result := mload(add(testFoo, 32))
    }
 }




}

